import React from 'react'

const VidioCard = ({vidio}) => {
    console.log()
    return (
        // imageurl={} title={} description={} channelName={}
        <Card channelName={vidio.snippet.channelTitle} description={vidio.snippet.description} imageurl={vidio.snippet.thumbnails.high.url}  />
    )
}

export default VidioCard
